        (lo, hi) = (1, 1000001)
        ans = 0
        while lo <= hi:
            mi = (lo + hi) // 2
            if ok(mi, k, v):
                ans = mi
                hi = mi - 1
            else:
                lo = mi + 1
        return ans
    if num == -1:
        return 1
    d = defaultdict(int)
    for i in range(2, int(math.sqrt(num)) + 1):
        while num % i == 0:
            d[i] += 1
            num //= i
    if num != 1:
        d[num] = 1
    ans = 0
    for (k, v) in d.items():
        if v == 1:
            ans = max(ans, k)
        else:
            ans = max(ans, search(k, v))
    return ans

